                    "article": "Barking &mdash; это крафтовое пиво, авторская кухня и бар в баре.<br /><br />В баре вас ждут более 10 сортов крафтового и 50 видов бутылочного.<br />У нас представлено пиво США, Англии, Шотландии, Бельгии, Германии и Дании. <br />Но мы всегда готовы предложить вам что-то новое, линейка постоянно меняется.<br /><br />Десятки позиций авторского стритфуда от 190 рублей, а также стейки, экзотические салаты и многое другое! <br /><br />Голодным отсюда не уйдет никто!<br /><br />Интерьер бара выполнен в индустриальном стиле: кирпичная кладка и граффити на стенах, лампы в стиле лофт, постеры и жестяные таблички удивительно удачно сочетаются с диванами в стиле барокко и мебелью ручной работы.<br /><br />Ждем вас за стойкой!",
