                    "article": "С 2014 года на Б. Конюшенной, 29 работает официальный форпост одного из крупнейших и знаменитых кафе Европы &mdash; бельгийской группы Palm Belgian Craft Brewers, чья история берет свой отсчет с 16-го века. Официальное признание в качестве бренд-амбассадора Palm сделало наш проект в исторической части Северной столицы первым и единственным заведением подобного статуса за пределами Бельгии и Нидерландов. <br /><br />Сегодня брассерия Palm на Большой Конюшенной, 29 &mdash; это богатый ассортимент аутентичных бельгийских сортов напитков, в том числе изысканных Rodenbach, Boon и Steenbrugge; настоящая бельгийская кухня из лучших продуктов, а также широкие компетенции нашей &laquo;материнской&raquo; компании в плане подбора оптимальных сочетаний. Бельгийская брассерия Palm на Б. Конюшенной отлично вписывается в сообщество одной из признанных ресторанных улиц Петербурга и предлагает классический отдых свои гостям.",
