                    "article": "В караоке-баре &laquo;ФаНеРА&raquo; поют даже стены.<br />Звук в &laquo;ФаНеРЕ&raquo; &mdash; дело профессионалов высокого класса. Звукорежиссер, ведущий, бэк-вокалистка, DJ &mdash; команда, которая помогает раскрыться певческому таланту каждого гостя. В базе караоке-бара 40 000 песен. Разброс жанров позволяет выбрать композицию, попадающую в такт вечера, в тон настроения. В музыкальных паузах можно потанцевать.<br />Меню &laquo;ФаНеРЫ&raquo; вторит музыкальному настроению и добавляет ему вкуса. Здесь предложат отведать легкие и вкусные блюда: рулеты из малосольного лосося, норвежскую семгу, салат из языка с маринованными огурцами, клубничный суп. А также суши-меню для настоящих гурманов. Бармены заведения &mdash; мастера не только в приготовлении коктейлей, но и в создании уникальной атмосферы, которая позволяет получить максимум положительных эмоций от пребывания в нашем караоке-баре!",
